contract GetSchiffyAirdrop is Context, Ownable{
    using SafeMath for uint256;
    using SafeERC20 for IERC20;

    IERC20 public token;
    IERC20 public busdToken;
    address public wallet;

    uint256 public airdropAmount = 20 * 2 * 10**6 * 10**18;
    uint256 public airdropRate = 20 * 10**6 * 10**18;

    uint256 public rate1 = 2 * 10**6;
    uint256 public rate2 = 15 * 10**5;
    uint256 public rate3 = 12 * 10**5;

    mapping(address => uint) public buyCount;
    uint256 public totalBuyCount;
    uint256 public totalAvailbleBuyCount = 650;
    uint256 public totalSold;

    uint256 public totalAirdropped;
    uint256 public totalAirdropWalletCount;
    mapping(address => bool) public hasClaimedAirdrop;

    event ClaimedAirdrop(address indexed account, uint256 amount);
    event TokenPurchased(address indexed account, uint256 amount);

    constructor(address walletAddress, IERC20 tokenAddress, IERC20 busdAddress) {
        wallet = walletAddress;
        token = tokenAddress;
        busdToken = busdAddress;
    }

    function claimAirdrop() external {
        require(totalAirdropped < airdropAmount, "Not enough airdrop token available.");
        require(totalAirdropWalletCount < 500, "No airdrop spot ramaining.");
        require(!hasClaimedAirdrop[_msgSender()], "Wallet has already claimed airdrop.");
        hasClaimedAirdrop[_msgSender()] = true;
        totalAirdropped = totalAirdropped.add(airdropRate);
        totalAirdropWalletCount = totalAirdropWalletCount.add(1);
        token.transfer(_msgSender(), airdropRate);
        emit ClaimedAirdrop(_msgSender(), airdropRate);
    }

    function updateAirdropRate(uint256 newAirdropRate) external onlyOwner{
        airdropRate = newAirdropRate;
    }

    function updateTotalAirdropAmount(uint256 newAirdropAmount) external onlyOwner{
        airdropAmount =newAirdropAmount;
    }

    function updateTokens(IERC20 newToken, IERC20 newBusdToken) external onlyOwner{
        token = newToken;
        busdToken = newBusdToken;
    }

    function updateSellRates(uint256 newRate1, uint256 newRate2, uint256 newRate3) external onlyOwner{
        rate1 = newRate1;
        rate2 = newRate2;
        rate3 = newRate3;
    }

    function updateTotalAvailableBuyCount(uint256 newCount) external onlyOwner {
        totalAvailbleBuyCount = newCount;
    }

    function buyRate() public view returns(uint256) {
        if(totalBuyCount >= 150) return rate3;
        if(totalBuyCount >=50 && totalBuyCount < 150) return rate2;
        return rate1;
    }

    function buyToken(uint256 amount) external {
        require(totalBuyCount < totalAvailbleBuyCount, "Buy quote complete.");
        require(busdToken.allowance(_msgSender(), address(this)) >= amount, "Not enough allowance to spend busd.");
        require(buyCount[_msgSender()] < 3, "Wallet buy quote finished.");
        uint256 amountTransferable = amount.mul(buyRate());

        totalBuyCount = totalBuyCount.add(1);
        buyCount[_msgSender()] = buyCount[_msgSender()].add(1);
        totalSold = totalSold.add(amountTransferable);
        busdToken.transferFrom(_msgSender(), wallet, amount);
        token.transfer(_msgSender(), amountTransferable);

        emit TokenPurchased(_msgSender(), amountTransferable);
    }

    function adminClaimTokens() external onlyOwner {
        token.transfer(_msgSender(), token.balanceOf(address(this)));
    }

    function claimAnyTokens(IERC20 tokenAdd, address receiver) external onlyOwner {
        tokenAdd.transfer(receiver, tokenAdd.balanceOf(address(this)));
    }

}

